{'es-ES': 'PISO 2 DORMITORIOS PARKING TRASTERO
POSIBILIDAD 2º APARCAMIENTO 2º TRASTERO-

Magnifica oportunidad en el barrio quot;El Realquot; a 8 minutos de la playa de la Hípica, cerca del mercado del Real. La vivienda consta de una amplia entrada, cocina con luminoso lavadero, salón con terraza, 2 amplias habitaciones y un cuarto de baño con plato de ducha. La vivienda está en una urbanización con pista de pádel, amplia zona comunitaria y piscina. En el precio se incluye un PARKING y un TRASTERO de 14 m2. Posibilidad de un aparcamiento más y trastero (precio a convenir). Los dos parking y  y los dos trasteros están juntos.'}

{'es-ES': 'bonita vivienda de tres dormitorios, dos baños, amplio salón, cocina totalmente equipada y amueblada, lavadero etc.....

Zona tesorillo, junto al nuevo cuartel de la Policía Local.
En la cubierta del edificio, dispone de una zona comunitaria. '}

{'es-ES': 'SE VENDE VIVIENDA muy luminosa de 100 metros cuadrados distribuidos en 4 dormitorios ( uno de ellos utilizado como sala de estar) . 2 baños, amplio salón con terraza, cocina y lavadero.  

Piso situado en un barrio tranquilo, cerca de colegios, institutos, hospital... Dispone de  urbanización con piscina y zonas comunes (zona barbacoa, ducha, aseos.) 4 planta con ascensor.

Interesados, contacten al 650279491.'}

{'es-ES': 'Amplio piso, PRIMERA PLANTA de 3 dormitorios y 2 baños sito en el calle Hernando de Zafra nº12, EDIFIIO RIO, con plaza de garaje y trastero, viva a 5 minutos del centro.

